import React from 'react'

// object destructuring
//! refference link => https://medium.com/@pyrolistical/destructuring-nested-objects-9dabdd01a3b8
const MovieComponent = ({
  match: {
    params: { id },
  },
}) => {
  return <h4>movie component {id}</h4>
}

export default MovieComponent
